import React, { Component } from "react";
import axios from "axios";
import reactDom from "react-dom";

class Reportes extends Component {
    state = {
        clientes: [],
        status: null
    }

    componentWillMount() {
        this.getClientes();
    }

    getClientes = () => {
        //Trae todos los productos de la api
        axios.get("http://localhost:8082/clientes/listar")
            .then(res => {
                console.log(res.data);
                this.setState({
                    clientes: res.data
                })
            });
    }
    render() {
        return (
            <div>
                <p>Reportes</p>
                <table class="table">
                    <thead class="thead-dark">
                        <tr>
                            <th scope="col">Cedula</th>
                            <th scope="col">Nombre</th>
                            <th scope="col">Correo</th>
                            <th scope="col">Direccion</th>
                            <th scope="col">Telefono</th>
                            <th scope="col">Acciones</th>

                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.clientes.map((cliente) => {
                                return (
                                    <React.Fragment>
                                        <tr>
                                            <td class="col-md-4 mx-auto">{cliente.cedula}</td>
                                            <td class="col-md-4 mx-auto">{cliente.nombre}</td>
                                            <td class="col-md-4 mx-auto">{cliente.correo}</td>
                                            <td class="col-md-4 mx-auto">{cliente.direccion}</td>
                                            <td class="col-md-4 mx-auto">{cliente.telefono}</td>
                                            <td class="col-md-4 mx-auto">
                                                <div class="form-goup p-2 center">
                                                    <button type="submit" class="btn btn-primary btn-block">
                                                        Editar
                                                    </button>
                                                </div>
                                                <div class="form-goup p-2 center">
                                                    <button type="submit" class="btn btn-primary btn-block">
                                                        Eliminar
                                                    </button>
                                                </div>
                                            </td>
                                        </tr>
                                    </React.Fragment>
                                )
                            })
                        }
                    </tbody>
                </table>
            </div>
        );
    }
}

export default Reportes;
